import React, { Component } from "react";
const ModelViewer = require("../../assets/images/metamask.svg");

export default class MetaViewer extends Component {
  render() {
    ModelViewer({
      width: 0.4,
      height: 0.4,
      followMouse: true,
      followMotion: true,
    });
    return <div></div>;
  }
}
